import React, {useState} from 'react';
import {useDispatch} from "react-redux";
import {createGoods} from "../../actions/goods.js";


const Create = (props) => {
    let name
    let cost
    let descript
    let file
    const dispatch = useDispatch()
    

    return (
            <form >
                <input type="file" value={file} accept="image/*"/>
                <input type="text" value={name}/>
                <input type="text" value={cost}/>
                <input type="text" value={descript}/>
                <button onClick={() => {dispatch(createGoods(name, cost, descript, file)); console.log(name)}}>gf</button>
            </form>
    )
}

export default Create
